import React, { Component } from 'react';

import './header.css';

class Header extends Component {
    render(){

        return(<div className="header">
        <div className="jumbotron">

        </div>
        <p>This is some text.</p> 
        <p>This is another text.</p> 
      </div>)
    }
}

export default Header;
